  return (
    <div className='fntbg'>
        <div >
            <div >
            <h1 className='head1 ms-4 text-white'>Online shopping Hub</h1>
        <h2 className='head2 ms-5 mt-5 text-white'>Percentage Off: 10%,20%,30% off on minimum purchase.</h2>
        <h3 className='head3 ms-5 text-white'>Combine related products at a discounted price.</h3>
        <h3 className='head4 ms-5 '>Limited-time discount on select products.</h3>
    </div>
    </div>
    </div>
  )
}

export default Fstpage
